import React, { useEffect, useState } from "react";

const pageStyle: React.CSSProperties = {
  background: "#f6f6f6",
  minHeight: "100vh",
  padding: "32px 0",
  fontFamily: "'Inter', 'Segoe UI', Arial, sans-serif",
};

const headerStyle: React.CSSProperties = {
  margin: "0 0 24px 0",
  fontWeight: 700,
  fontSize: "2rem",
  color: "#222",
  textAlign: "left",
  paddingLeft: "24px",
  letterSpacing: "0.01em",
  fontFamily: "'Inter', 'Segoe UI', Arial, sans-serif",
};

const searchStyle: React.CSSProperties = {
  display: "flex",
  alignItems: "center",
  margin: "0 0 24px 0",
  paddingLeft: "24px",
};

const inputStyle: React.CSSProperties = {
  padding: "12px 18px",
  borderRadius: "12px",
  border: "1px solid #e0e0e0",
  fontSize: "1rem",
  width: "60%",
  marginRight: "12px",
  background: "#f9f9f9",
  fontFamily: "'Inter', 'Segoe UI', Arial, sans-serif",
};

const cardContainerStyle: React.CSSProperties = {
  display: "flex",
  flexWrap: "wrap",
  gap: "32px",
  paddingLeft: "24px",
};

const cardStyle: React.CSSProperties = {
  background: "#fff",
  borderRadius: "24px",
  boxShadow: "0 4px 24px rgba(0,0,0,0.06)",
  padding: "32px",
  width: "320px",
  display: "flex",
  flexDirection: "column",
  alignItems: "center",
  marginBottom: "32px",
};

const imgStyle: React.CSSProperties = {
  width: "160px",
  height: "160px",
  objectFit: "cover",
  borderRadius: "18px",
  marginBottom: "18px",
  background: "#f6f6f6",
  border: "1px solid #eee",
};

const priceStyle: React.CSSProperties = {
  fontWeight: 700,
  fontSize: "1.2rem",
  color: "#c9a063",
  margin: "12px 0",
  fontFamily: "'Inter', 'Segoe UI', Arial, sans-serif",
};

const titleStyle: React.CSSProperties = {
  fontWeight: 700,
  fontSize: "1.15rem",
  marginBottom: "8px",
  fontFamily: "'Inter', 'Segoe UI', Arial, sans-serif",
  color: "#222",
  textAlign: "center" as const,
};

const descStyle: React.CSSProperties = {
  color: "#b6a77c",
  fontSize: "0.98rem",
  marginBottom: "8px",
  fontFamily: "'Inter', 'Segoe UI', Arial, sans-serif",
  textAlign: "center" as const,
};

const infoRowStyle: React.CSSProperties = {
  display: "flex",
  justifyContent: "space-between",
  width: "100%",
  marginBottom: "8px",
  fontSize: "0.98rem",
  color: "#888",
};

const badgeStyle: React.CSSProperties = {
  background: "#f6e9d7",
  color: "#c9a063",
  borderRadius: "8px",
  padding: "4px 12px",
  fontWeight: 600,
  fontSize: "0.95rem",
  marginBottom: "8px",
  fontFamily: "'Inter', 'Segoe UI', Arial, sans-serif",
};

const ListingPage = () => {
  const [listings, setListings] = useState<any[]>([]);
  const [search, setSearch] = useState("");

  useEffect(() => {
    fetch("http://localhost:9090/lighting/api/products")
      .then((res) => res.json())
      .then((data) => setListings(data))
      .catch(() => setListings([]));
  }, []);

  const filteredListings = listings.filter(
    (item) =>
      item.name?.toLowerCase().includes(search.toLowerCase()) ||
      item.location?.toLowerCase().includes(search.toLowerCase()) ||
      item.title?.toLowerCase().includes(search.toLowerCase()) ||
      item.categoryDescription?.toLowerCase().includes(search.toLowerCase())
  );

  return (
    <div style={pageStyle}>
      <div style={headerStyle}>Find Your Dream Lights</div>
      <div style={searchStyle}>
        <input
          style={inputStyle}
          type="text"
          placeholder="Search by name, location, or category"
          value={search}
          onChange={(e) => setSearch(e.target.value)}
        />
      </div>
      <div style={cardContainerStyle}>
        {filteredListings.map((item) => (
          <div key={item.id} style={cardStyle}>
            <img
              src={
                item.imageUrl && item.imageUrl !== "default.jpg"
                  ? item.imageUrl
                  : "https://img.icons8.com/ios-filled/200/light.png"
              }
              alt={item.name}
              style={imgStyle}
            />
            <div style={badgeStyle}>{item.categoryDescription || "Lighting"}</div>
            <div style={titleStyle}>{item.title || item.name}</div>
            <div style={descStyle}>{item.description}</div>
            <div style={infoRowStyle}>
              <span>Order Code: {item.orderCode}</span>
              <span>Qty: {item.quantity}</span>
            </div>
            <div style={priceStyle}>â‚¹{item.price} INR</div>
            <button
              style={{
                background: "#c9a063",
                color: "#fff",
                border: "none",
                borderRadius: "12px",
                padding: "12px 28px",
                cursor: "pointer",
                fontWeight: 700,
                fontSize: "1rem",
                marginTop: "16px",
                fontFamily: "'Inter', 'Segoe UI', Arial, sans-serif"
              }}
            >
              Contact Seller
            </button>
          </div>
        ))}
      </div>
    </div>
  );
};

export default ListingPage;
